import React from "react";

const Product = ({ product }) => {
  return (
    <div className="flex justify-center">
      <div className="m-3 p-3 md:h-72 md:w-72 h-80 w-80 rounded-lg border-2 border-gray-500 shadow-xl">
        <img className="p-4 " src={product.image} alt="" />
        <div className="">
          <strong className="">{product.name}</strong>
          <strong className="m-1">{product.price}</strong>
        </div>
      </div>
    </div>
  );
};

export default Product;
